// src/App.js
import React from 'react';
import Navbar from './components/Navbar';
import SearchBar from './components/SearchBar'; // This is the new search bar
import FeaturedSection from './components/FeaturedSection';
import ProfileSection from './components/ProfileSection';
import Footer from './components/Footer';
import './App.css';

const App = () => {
  return (
    <div className="app">
      <Navbar />
      <SearchBar /> {/* Retain only the new SearchBar component */}

      <main>
        <ProfileSection />
        <FeaturedSection />
      </main>

      <Footer />
    </div>
  );
};

export default App;
